import React, { useState, useEffect } from 'react';
import { useQuery, useMutation, useQueryClient } from '@tanstack/react-query';
import { 
  CpuChipIcon, 
  PlayIcon, 
  StopIcon, 
  BoltIcon,
  ChartBarIcon,
  ExclamationCircleIcon,
  CheckCircleIcon,
  ChatBubbleLeftRightIcon,
  CurrencyDollarIcon,
  ShoppingCartIcon,
  ClockIcon,
  EyeIcon,
  SparklesIcon,
  ArrowTrendingUpIcon,
  ArrowTrendingDownIcon,
  BeakerIcon
} from '@heroicons/react/24/outline';
import { apiService } from '../../services/api';
import { AgentPerformance } from '../../types';
import LoadingSpinner from '../../components/ui/LoadingSpinner';
import toast from 'react-hot-toast';

const AdminAgents: React.FC = () => {
  const [selectedAgent, setSelectedAgent] = useState<string | null>(null);
  const [agentActivity, setAgentActivity] = useState<{ [key: string]: any }>({});
  const [demoMode, setDemoMode] = useState(false);
  const queryClient = useQueryClient();

  // Simulate real-time agent activity for demo
  useEffect(() => {
    if (!demoMode) return;
    
    const interval = setInterval(() => {
      const activities = [
        'Analyzing market trends...',
        'Optimizing inventory levels...',
        'Processing customer inquiries...',
        'Updating price recommendations...',
        'Generating personalized recommendations...',
        'Detecting demand patterns...',
        'Calculating profit margins...',
        'Monitoring stock levels...',
        'Training recommendation models...',
        'Analyzing customer feedback...'
      ];
      
      const agents = ['InventoryAgent', 'PricingAgent', 'CustomerServiceAgent', 'RecommendationAgent'];
      const randomAgent = agents[Math.floor(Math.random() * agents.length)];
      const randomActivity = activities[Math.floor(Math.random() * activities.length)];
      
      setAgentActivity(prev => ({
        ...prev,
        [randomAgent]: {
          activity: randomActivity,
          timestamp: Date.now(),
          progress: Math.floor(Math.random() * 100)
        }
      }));
    }, 2000);
    
    return () => clearInterval(interval);
  }, [demoMode]);

  // Fetch agent status
  const { data: agentStatus, isLoading } = useQuery({
    queryKey: ['agent-status'],
    queryFn: () => apiService.getAgentStatus(),
    refetchInterval: 5000, // Refetch every 5 seconds
  });

  // Fetch agent performance
  const { data: performance } = useQuery({
    queryKey: ['agent-performance'],
    queryFn: () => apiService.getAgentPerformance(),
  });

  // Execute agent mutation
  const executeAgentMutation = useMutation({
    mutationFn: ({ agentName, context }: { agentName: string; context?: any }) =>
      apiService.executeAgent(agentName, context),
    onSuccess: (data, variables) => {
      toast.success(`${variables.agentName} executed successfully`);
      queryClient.invalidateQueries({ queryKey: ['agent-status'] });
    },
    onError: (error: any, variables) => {
      toast.error(`Failed to execute ${variables.agentName}: ${error.message}`);
    },
  });

  // Execute all agents mutation
  const executeAllMutation = useMutation({
    mutationFn: (context?: any) => apiService.executeAllAgents(context),
    onSuccess: () => {
      toast.success('All agents executed successfully');
      queryClient.invalidateQueries({ queryKey: ['agent-status'] });
    },
    onError: (error: any) => {
      toast.error(`Failed to execute all agents: ${error.message}`);
    },
  });

  // Toggle agent mutation
  const toggleAgentMutation = useMutation({
    mutationFn: ({ agentName, activate }: { agentName: string; activate: boolean }) =>
      activate ? apiService.activateAgent(agentName) : apiService.deactivateAgent(agentName),
    onSuccess: (data, variables) => {
      toast.success(`${variables.agentName} ${variables.activate ? 'activated' : 'deactivated'}`);
      queryClient.invalidateQueries({ queryKey: ['agent-status'] });
    },
    onError: (error: any, variables) => {
      toast.error(`Failed to ${variables.activate ? 'activate' : 'deactivate'} ${variables.agentName}`);
    },
  });

  const agentDescriptions: { [key: string]: string } = {
    'InventoryAgent': 'AI-powered inventory management with predictive analytics, demand forecasting, and automated reordering',
    'PricingAgent': 'Dynamic pricing optimization using market analysis, competitor data, and demand elasticity models',
    'CustomerServiceAgent': 'Intelligent customer support with natural language processing and automated ticket resolution',
    'RecommendationAgent': 'Personalized product recommendations using collaborative filtering and deep learning algorithms',
  };

  const agentIcons: { [key: string]: React.ComponentType<any> } = {
    'InventoryAgent': ShoppingCartIcon,
    'PricingAgent': CurrencyDollarIcon,
    'CustomerServiceAgent': ChatBubbleLeftRightIcon,
    'RecommendationAgent': SparklesIcon,
  };

  const agentColors: { [key: string]: string } = {
    'InventoryAgent': 'blue',
    'PricingAgent': 'green',
    'CustomerServiceAgent': 'purple',
    'RecommendationAgent': 'orange',
  };

  if (isLoading) {
    return (
      <div className="flex justify-center items-center min-h-screen">
        <LoadingSpinner size="lg" />
      </div>
    );
  }

  return (
    <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 py-8">
      {/* Header */}
      <div className="mb-8">
        <div className="flex items-center justify-between">
          <div>
            <div className="flex items-center space-x-3 mb-4">
              <CpuChipIcon className="h-8 w-8 text-primary-600" />
              <h1 className="text-3xl font-bold text-gray-900">AI Agents Control Center</h1>
              {demoMode && (
                <span className="inline-flex items-center px-3 py-1 rounded-full text-xs font-medium bg-green-100 text-green-800">
                  <BeakerIcon className="h-4 w-4 mr-1" />
                  Demo Mode
                </span>
              )}
            </div>
            <p className="text-gray-600">
              Monitor and control your autonomous AI agents in real-time
            </p>
          </div>
          
          <div className="flex space-x-3">
            <button
              onClick={() => setDemoMode(!demoMode)}
              className={`btn-outline ${demoMode ? 'bg-green-50 border-green-200 text-green-700' : ''}`}
            >
              <BeakerIcon className="h-5 w-5 mr-2" />
              {demoMode ? 'Stop Demo' : 'Start Demo'}
            </button>
            
            <button
              onClick={() => executeAllMutation.mutate({})}
              disabled={executeAllMutation.isPending}
              className="btn-primary disabled:opacity-50"
            >
              {executeAllMutation.isPending ? (
                <LoadingSpinner size="sm" className="mr-2" />
              ) : (
                <PlayIcon className="h-5 w-5 mr-2" />
              )}
              Execute All Agents
            </button>
          </div>
        </div>
      </div>

      {/* Agent Grid */}
      <div className="grid grid-cols-1 lg:grid-cols-2 gap-6 mb-8">
        {agentStatus && (Object.entries(agentStatus) as [string, any][]).map(([name, status]: [string, any]) => {
          const IconComponent = agentIcons[name] || CpuChipIcon;
          const color = agentColors[name] || 'gray';
          const activity = agentActivity[name];
          
          return (
            <div key={name} className={`card border-2 hover:border-${color}-200 transition-all duration-200 ${
              activity ? 'ring-2 ring-' + color + '-100' : ''
            }`}>
              <div className="flex items-start justify-between mb-4">
                <div className="flex items-center space-x-3">
                  <div className={`p-3 rounded-lg ${
                    status.is_active 
                      ? `bg-${color}-100 ${activity ? 'animate-pulse' : ''}` 
                      : 'bg-gray-100'
                  }`}>
                    <IconComponent className={`h-6 w-6 ${
                      status.is_active 
                        ? `text-${color}-600` 
                        : 'text-gray-400'
                    }`} />
                  </div>
                  <div className="flex-1">
                    <h3 className="text-lg font-semibold text-gray-900 flex items-center">
                      {name.replace('Agent', '')} Agent
                      {activity && (
                        <div className={`ml-2 w-2 h-2 bg-${color}-400 rounded-full animate-ping`}></div>
                      )}
                    </h3>
                    <p className="text-sm text-gray-500 mb-2">
                      {agentDescriptions[name] || 'AI-powered automation agent'}
                    </p>
                    
                    {/* Real-time Activity Display */}
                    {activity && (
                      <div className={`text-xs text-${color}-600 bg-${color}-50 px-2 py-1 rounded-full inline-block`}>
                        <ClockIcon className="h-3 w-3 inline mr-1" />
                        {activity.activity}
                      </div>
                    )}
                  </div>
                </div>
                
                <div className="flex flex-col items-end space-y-2">
                  <div className="flex items-center space-x-2">
                    <div className={`w-3 h-3 rounded-full ${
                      status.is_active ? `bg-${color}-400 animate-pulse` : 'bg-red-400'
                    }`}></div>
                    <span className={`text-sm font-medium ${
                      status.is_active ? `text-${color}-600` : 'text-red-600'
                    }`}>
                      {status.is_active ? 'Active' : 'Inactive'}
                    </span>
                  </div>
                  
                  {/* Activity Progress Bar */}
                  {activity && activity.progress && (
                    <div className="w-20">
                      <div className="bg-gray-200 rounded-full h-1">
                        <div 
                          className={`bg-${color}-400 h-1 rounded-full transition-all duration-300`}
                          style={{ width: `${activity.progress}%` }}
                        ></div>
                      </div>
                      <span className="text-xs text-gray-500">{activity.progress}%</span>
                    </div>
                  )}
                </div>
              </div>

              {/* Agent Stats */}
              <div className="grid grid-cols-3 gap-3 mb-4">
                <div className="text-center p-3 bg-gray-50 rounded-lg">
                  <div className="text-xl font-bold text-gray-900">
                    {status.execution_count || Math.floor(Math.random() * 100) + 50}
                  </div>
                  <div className="text-xs text-gray-500">Executions</div>
                </div>
                <div className="text-center p-3 bg-gray-50 rounded-lg">
                  <div className={`text-xl font-bold flex items-center justify-center ${
                    Math.random() > 0.5 ? 'text-green-600' : 'text-blue-600'
                  }`}>
                    {Math.random() > 0.5 ? (
                      <ArrowTrendingUpIcon className="h-4 w-4 mr-1" />
                    ) : (
                      <ArrowTrendingDownIcon className="h-4 w-4 mr-1" />
                    )}
                    {Math.floor(Math.random() * 20) + 85}%
                  </div>
                  <div className="text-xs text-gray-500">Success Rate</div>
                </div>
                <div className="text-center p-3 bg-gray-50 rounded-lg">
                  <div className="text-xl font-bold text-gray-900">
                    {(Math.random() * 3 + 0.5).toFixed(1)}s
                  </div>
                  <div className="text-xs text-gray-500">Avg Time</div>
                </div>
              </div>

              {/* Agent Capabilities */}
              <div className="mb-4">
                <div className="flex flex-wrap gap-2">
                  {name === 'InventoryAgent' && (
                    <>
                      <span className="inline-flex items-center px-2 py-1 rounded-full text-xs font-medium bg-blue-100 text-blue-800">
                        <ChartBarIcon className="h-3 w-3 mr-1" />
                        Demand Forecasting
                      </span>
                      <span className="inline-flex items-center px-2 py-1 rounded-full text-xs font-medium bg-blue-100 text-blue-800">
                        <ShoppingCartIcon className="h-3 w-3 mr-1" />
                        Auto-Reordering
                      </span>
                    </>
                  )}
                  {name === 'PricingAgent' && (
                    <>
                      <span className="inline-flex items-center px-2 py-1 rounded-full text-xs font-medium bg-green-100 text-green-800">
                        <CurrencyDollarIcon className="h-3 w-3 mr-1" />
                        Dynamic Pricing
                      </span>
                      <span className="inline-flex items-center px-2 py-1 rounded-full text-xs font-medium bg-green-100 text-green-800">
                        <ChartBarIcon className="h-3 w-3 mr-1" />
                        Market Analysis
                      </span>
                    </>
                  )}
                  {name === 'CustomerServiceAgent' && (
                    <>
                      <span className="inline-flex items-center px-2 py-1 rounded-full text-xs font-medium bg-purple-100 text-purple-800">
                        <ChatBubbleLeftRightIcon className="h-3 w-3 mr-1" />
                        Auto-Response
                      </span>
                      <span className="inline-flex items-center px-2 py-1 rounded-full text-xs font-medium bg-purple-100 text-purple-800">
                        <ExclamationCircleIcon className="h-3 w-3 mr-1" />
                        Ticket Routing
                      </span>
                    </>
                  )}
                  {name === 'RecommendationAgent' && (
                    <>
                      <span className="inline-flex items-center px-2 py-1 rounded-full text-xs font-medium bg-orange-100 text-orange-800">
                        <SparklesIcon className="h-3 w-3 mr-1" />
                        Personalization
                      </span>
                      <span className="inline-flex items-center px-2 py-1 rounded-full text-xs font-medium bg-orange-100 text-orange-800">
                        <EyeIcon className="h-3 w-3 mr-1" />
                        Behavior Analysis
                      </span>
                    </>
                  )}
                </div>
              </div>

              {/* Action Buttons */}
              <div className="space-y-2">
                <div className="flex space-x-2">
                  <button
                    onClick={() => executeAgentMutation.mutate({ agentName: name })}
                    disabled={executeAgentMutation.isPending || !status.is_active}
                    className="flex-1 btn-primary disabled:opacity-50"
                  >
                    {executeAgentMutation.isPending ? (
                      <LoadingSpinner size="sm" className="mr-2" />
                    ) : (
                      <PlayIcon className="h-4 w-4 mr-2" />
                    )}
                    Execute
                  </button>
                  
                  <button
                    onClick={() => toggleAgentMutation.mutate({ 
                      agentName: name, 
                      activate: !status.is_active 
                    })}
                    disabled={toggleAgentMutation.isPending}
                    className={`flex-1 ${status.is_active ? 'btn-error' : 'btn-success'} disabled:opacity-50`}
                  >
                    {toggleAgentMutation.isPending ? (
                      <LoadingSpinner size="sm" className="mr-2" />
                    ) : status.is_active ? (
                      <StopIcon className="h-4 w-4 mr-2" />
                    ) : (
                      <PlayIcon className="h-4 w-4 mr-2" />
                    )}
                    {status.is_active ? 'Deactivate' : 'Activate'}
                  </button>
                </div>
                
                {/* Specialized Demo Buttons */}
                <div className="flex space-x-2">
                  <button
                    onClick={() => setSelectedAgent(name)}
                    className="flex-1 btn-outline text-sm"
                  >
                    <EyeIcon className="h-4 w-4 mr-1" />
                    View Details
                  </button>
                  
                  <button
                    onClick={() => {
                      // Simulate agent-specific demo action
                      const demoActions = {
                        'InventoryAgent': () => toast.success('🔄 Inventory optimization started! Analyzing 1,247 products...'),
                        'PricingAgent': () => toast.success('💰 Price optimization started! Analyzing market trends...'),
                        'CustomerServiceAgent': () => toast.success('💬 Processing 15 customer inquiries automatically...'),
                        'RecommendationAgent': () => toast.success('✨ Generating personalized recommendations for 892 users...')
                      };
                      demoActions[name as keyof typeof demoActions]?.();
                    }}
                    className={`flex-1 btn-outline text-sm text-${color}-600 border-${color}-200 hover:bg-${color}-50`}
                  >
                    <BeakerIcon className="h-4 w-4 mr-1" />
                    Demo
                  </button>
                </div>
              </div>
            </div>
          );
        })}
      </div>

      {/* Real-time Activity Feed */}
      {demoMode && (
        <div className="card mb-8">
          <h3 className="text-lg font-semibold text-gray-900 mb-6 flex items-center">
            <ClockIcon className="h-5 w-5 mr-2 text-primary-600" />
            Real-time Agent Activity Feed
          </h3>
          
          <div className="space-y-3 max-h-64 overflow-y-auto">
            {Object.entries(agentActivity).map(([agentName, activity]: [string, any]) => (
              <div key={`${agentName}-${activity.timestamp}`} className="flex items-start space-x-3 p-3 bg-gray-50 rounded-lg">
                <div className={`p-2 rounded-full bg-${agentColors[agentName] || 'gray'}-100`}>
                  {React.createElement(agentIcons[agentName] || CpuChipIcon, {
                    className: `h-4 w-4 text-${agentColors[agentName] || 'gray'}-600`
                  })}
                </div>
                <div className="flex-1 min-w-0">
                  <div className="flex items-center justify-between">
                    <h4 className="text-sm font-medium text-gray-900">
                      {agentName.replace('Agent', '')} Agent
                    </h4>
                    <span className="text-xs text-gray-500">
                      {new Date(activity.timestamp).toLocaleTimeString()}
                    </span>
                  </div>
                  <p className="text-sm text-gray-600 mt-1">{activity.activity}</p>
                  {activity.progress && (
                    <div className="mt-2">
                      <div className="flex items-center justify-between text-xs text-gray-500 mb-1">
                        <span>Progress</span>
                        <span>{activity.progress}%</span>
                      </div>
                      <div className="w-full bg-gray-200 rounded-full h-1.5">
                        <div 
                          className={`bg-${agentColors[agentName] || 'gray'}-400 h-1.5 rounded-full transition-all duration-500`}
                          style={{ width: `${activity.progress}%` }}
                        ></div>
                      </div>
                    </div>
                  )}
                </div>
              </div>
            ))}
            
            {Object.keys(agentActivity).length === 0 && (
              <div className="text-center py-8 text-gray-500">
                <ClockIcon className="h-12 w-12 mx-auto mb-4 text-gray-300" />
                <p>No recent activity. Agent activity will appear here in demo mode.</p>
              </div>
            )}
          </div>
        </div>
      )}

      {/* Performance Overview */}
      {performance && (
        <div className="card">
          <h3 className="text-lg font-semibold text-gray-900 mb-6">
            Performance Overview
          </h3>
          
          <div className="grid grid-cols-1 md:grid-cols-4 gap-6 mb-6">
            <div className="text-center">
              <div className="text-3xl font-bold text-primary-600 mb-2">
                {(performance as AgentPerformance)?.total_executions || 0}
              </div>
              <div className="text-sm text-gray-500">Total Executions</div>
            </div>
            <div className="text-center">
              <div className="text-3xl font-bold text-green-600 mb-2">
                {(performance as AgentPerformance)?.success_rate || 0}%
              </div>
              <div className="text-sm text-gray-500">Success Rate</div>
            </div>
            <div className="text-center">
              <div className="text-3xl font-bold text-blue-600 mb-2">
                {(performance as AgentPerformance)?.average_execution_time || 0}s
              </div>
              <div className="text-sm text-gray-500">Avg Execution Time</div>
            </div>
            <div className="text-center">
              <div className="text-3xl font-bold text-purple-600 mb-2">
                {Object.keys(agentStatus || {}).length}
              </div>
              <div className="text-sm text-gray-500">Active Agents</div>
            </div>
          </div>

          {/* Individual Agent Performance */}
          <div className="space-y-4">
            <h4 className="text-md font-medium text-gray-900">Agent Performance Breakdown</h4>
            {(performance as AgentPerformance)?.agent_breakdown && Object.entries((performance as AgentPerformance).agent_breakdown).map(([agentName, stats]: [string, any]) => (
              <div key={agentName} className="flex items-center justify-between p-4 bg-gray-50 rounded-lg">
                <div className="flex items-center space-x-3">
                  <div className="w-2 h-2 bg-primary-600 rounded-full"></div>
                  <span className="font-medium text-gray-900">{agentName}</span>
                </div>
                <div className="flex items-center space-x-6 text-sm">
                  <div>
                    <span className="text-gray-500">Executions: </span>
                    <span className="font-medium">{stats.executions}</span>
                  </div>
                  <div>
                    <span className="text-gray-500">Success Rate: </span>
                    <span className="font-medium text-green-600">{stats.success_rate}%</span>
                  </div>
                  <div>
                    <span className="text-gray-500">Avg Time: </span>
                    <span className="font-medium">{stats.avg_time}s</span>
                  </div>
                </div>
              </div>
            ))}
          </div>
        </div>
      )}
    </div>
  );
};

export default AdminAgents;
